import React from "react";
import PostHelp from "./posthelpa";
import { useState } from "react";
import { useEffect } from "react";
import { getAllPointHelp } from "../http/feth";

const ListHelp = (props) => {
  const [persons, setPersons] = useState([])

  useEffect(() => {
    getAllPointHelp().then(data => setPersons(data))
  }, [])

  return (<div>

<div class="dropdown">
  <button class="btn btn-secondary dropdown-toggle" type="button" data-bs-toggle="dropdown" aria-expanded="false">
    Dropdown button
  </button>
  <ul class="dropdown-menu">
    <li><a class="dropdown-item" href="#">like</a></li>
    <li><a class="dropdown-item" href="#">views</a></li>
    <li><a class="dropdown-item" href="#">name</a></li>
  </ul>
</div>



    <ul>
      {persons.map(person => <PostHelp person={person} />)}
    </ul>
    </div>
  )

}
export default ListHelp
